import React, { Component } from 'react';
import { Button, Card, Elevation, H5, Icon } from '@blueprintjs/core';
import AppBar from '../../components/AppBar/AppBar';
import MainContainer from '../../components/MainContainer/MainContainer';
import Sidebar from '../../components/Sidebar/Sidebar';

export default class BluePrintView extends Component {
   render() {
      return (
         <div>
            <AppBar></AppBar>
            <MainContainer>
               <Sidebar />
               <Card
                  interactive={true}
                  elevation={Elevation.THREE}
                  className='m-3'
               >
                  <H5>Analytical applications</H5>
                  <p>
                     User interfaces that enable people to interact smoothly
                     with data, ask better questions, and make better decisions.
                  </p>
                  <Button>
                     <Icon icon='document'></Icon> Upload...
                  </Button>
               </Card>
            </MainContainer>
         </div>
      );
   }
}
